import React from "react"
import { View, Text } from "react-native"
export const LoginScreen = () => {
    return (
        <View style={{
            flex : 1,
            alignItems : 'center',
            justifyContent : 'center',
            backgroundColor : 'lightblue'
        }}>
            <View style={{
                width : '100%',
                height : '70%',
                backgroundColor : 'white',
                position : 'absolute',
                bottom : 0
            }}></View>
        </View>
    )
}
